        background-color: #FDEFF4;
        color: #000;
        border-radius: 8px;
        border: none;
        `
        const Link = styled.div`
        text-decoration: none;
 
 `
  return (
    <Container>
        <AmountPaid>Amount Paid Succcessfully</AmountPaid>
